yIYp.png)"]},{"cell_type":"markdown","id":"03b68a92","metadata":{"papermill":{"duration":0.005387,"end_time":"2022-08-29T20:54:18.40802","exception":false,"start_time":"2022-08-29T20:54:18.402633","status":"completed"},"tags":[]},"source":["#OBJECTIVE: Maximizing the number of members, converting casual members to members.\n","\n","#Ps: \n","#Customers who purchase single ride passes, full-day passes referred to as casual riders. \n","#Customers who purchase annual membership are Cyclistc members.\n","\n","#QUESTION: How do annual members and casual riders use Cyclistic bikes differently "]},{"cell_type":"markdown","id":"dee0304f","metadata":{"papermill":{"duration":0.005097,"end_time":"2022-08-29T20:54:18.418403","exception":false,"start_time":"2022-08-29T20:54:18.413306","status":"completed"},"tags":[]},"source":["#We need to avoid wrong results in our finds, in this dataset we have more than 96 thousands rows of registration.Also I find 37 rows that are not necessary for our analyze, then we can use clause where to filter wrong data.\n","\n","![19.png](https://i.imgur.com/3SuRb7K.png)"]},{"cell_type":"markdown","id":"9477c6dc","metadata":{"papermill":{"duration":0.005546,"end_time":"2022-08-29T20:54:18.429448","exception":false,"start_time":"2022-08-29T20:54:18.423902","status":"completed"},"tags":[]},"source":["#Now we filter our data using parameter duration <= ’24:00:00’.\n","\n","\n","![20.png](https://i.imgur.com/5dF5Twz.png)"]},{"cell_type":"markdown","id":"4caa8fd1","metadata":{"papermill":{"duration":0.005123,"end_time":"2022-08-29T20:54:18.439748","exception":false,"start_time":"2022-08-29T20:54:18.434625","status":"completed"},"tags":[]},"source":["#Also we can use another FUNCTION together to improve our result for each month like;\n","\n","#GROUP BY, ORDER BY AND WHERE.\n","\n","#We can find different points and another way to see our data, to have a better analyze and understand what want to Now we can take average for each group and how many casual 